div.div:
A secondary index may abstract either
- SortedMap<(SV, PK), Opt<PV>>
- SortedMap<(SV, PK), Opt<()>>
The former requires duplicating PV across all indexes (on disk and on memory).
The latter requires n+1 index usages per "get by range of SVs" type of query.
```
pks: Vec<PK> = si.get_range(cmp_lo, cmp_hi).map( |( (sv, pk), _)| pk );
ret: Vec<(PK, PV)> = vec![];
for each pk in pks:
pv = primary_index.get_one(pk);
ret.push( (pk, pv) );```
